import React from "react";
import { Link } from "react-router-dom";
const Resource = () => {
  return (
    <div>
      <section className="allDegree">
        <Link to="/resource">新手推薦</Link>
        <Link to="/resource">中級程度</Link>
        <Link to="/resource">高手專區</Link>
      </section>
    </div>
  );
};

export default Resource;
